import React, { useState } from "react";
import { TextCenter } from "react-bootstrap-icons";
import { Link } from "react-router-dom";
import Button from "react-bootstrap/Button";

export default function Default() {
    return (
        <div className="container py-5 px-3 my-4 rounded" style="background:#E9ECEF">
            <h1 className="display-4 pb-2">Welcome to Python Forums</h1>
            <p className="lead">Python is a high-level, general-purpose programming language. Its design philosophy
                emphasizes code readability with the use of significant indentation. Its language constructs and
                object-oriented approach aim to help programmers write clear, logical code</p>
            <hr>
                <p className="py-2">This is peer to peer forum for sharing knowledge with each other</p>
                <div className="btn btn-primary">Learn more</div>
            </hr>
        </div>
    );
};
